@EU_Commission @vonderleyen A los españoles no nos han hecho test! Seguimos con nuestros sanitarios sin la protección adecuada, un número muy alto de sanitarios contagiados!
No sabemos donde ha metido l NEFASTO desgobierno todo el material que ha comprado!
ESTO ES UNA QUEJA NO UNO DE LOS BULOS DEL GOBIERNO

@EU_Commission @vonderleyen Why have an EU?

The #EU is not at the heart of the coronavirus response.
The national borders must stay closed regardless of the EU.

@EU_Commission The problem is global, the solution is local.
Your long and crazy race towards competitiveness now obliges you to venture towards solidarity.
#HowDareEU?
